import React from "react";
import styled from "styled-components";

export const Content = styled.div`
  width: 15%;
  height: 50%;
  background: yellow;
  margin: 30px;
`;

export default function CardContent() {
  return (
    <>
      <Content></Content>
    </>
  );
}
